            {
                name: "상품1",
                path: "#"
            },
            {
                name: "상품1",
                path: "#"
            }]
    },
    {
        mainMenu: "아이템2",
        subMenu: [
            {
                name: "상품1",
                path: "#"
            },
            {
                name: "상품1",
                path: "#"
            }]
    }
];

const Nav = () => {
    return (
        <NavBlock>
            {navItem.map(item => <NavItem item={{item}}/>)}
        </NavBlock>
    )
};
export default Nav
